"""Duplicate of the default urlconf in urls.py.  This allows urls to be customized without breaking tests.  It also allows some extra views to be used for testing only."""# NOTE: Make sure this stays synchronized with urls.py.from django.conf.urls.defaults import *PREFIX = r'^linkanalytics/'urlpatterns = patterns('linkanalytics',    (PREFIX+r'create_target/$', 'views.createTrackedUrlTarget'),    (PREFIX+r'create_trackee/$', 'views.createTrackee'),    (PREFIX+r'create_trackedurl/$', 'views.createTrackedUrl'),    # The Regex for accessTrackedUrl: the ending '/' is optional.    (PREFIX+r'access/(?P<uuid>[a-f0-9]{32})/(?P<tailpath>(?:(?:/[-\w\d_.])|[-\w\d_.])+/?)$', 'views.accessTrackedUrl'),        # Some urls defined for testing purposes only.    (PREFIX+r'testurl/$', 'tests_views.testview'),)handler404 = 'linkanalytics.tests_views.on_page_not_found'